import { useState} from 'react'
import axios from 'axios'
function Signup(){
    const [name, SetName] = useState('');
    const [email, SetEmail] = useState('');
    const [role, SetRole] = useState('');
    const [password, SetPassword] = useState('');

    const handleChangesubmit =(e)=>{
        e.prevent.default()
        let paylod = {name,email,role,password}
        axios.post("https://localhost/api/create",paylod)
        .then((response)=>{
            console.log(response.data)
        }).catch(()=>{
            console.log('user not created')
        })
    }

    return(
        <div>
            <form onSubmit={handleChangesubmit}>
                <table>
                    <tr>
                    <label>
                    Name:
                    <td></td>
                </label>
                    </tr>
                </table>
                
                <label>
                    Email:
                    <input type='text'value={email} onChange={e => SetEmail(e.value.target)} placeholder='Enter your Email'></input>
                </label>
                <label>
                    Role:
                    <input type='text'value={role} onChange={e=> SetRole(e.value.target)} placeholder='Enter your role'></input>
                </label>
                <label>
                    Password:
                    <input type='text'value={password} onChange={e=>SetPassword(e.value.target)} placeholder='Enter your password'></input>
                </label>
                <br /><br />
                <button type='submit'>CreateUser</button>
            </form>
        </div>
    )
}
export default Signup;
